regions.text:
traduction: le droit exclusif d'autoriser ou d'interdire la traduction, l'adaptation, l’arrangement
ou la création d'ceuvres dérivées sur la base des résultats, et toute autre altération des
résultats, sous réserve du respect des droits moraux des auteurs, le cas échéant;

reproduction: le droit d'autoriser ou d'interdire la reproduction directe ou indirecte, provisoire
ou permanente, des résultats par quelque moyen (mécanique, numérique ou autre) et sous
quelque forme que ce soit, en tout ou en partie;

Stand: Neugefasst durch Bek. v. 6.1.2006 | 49;
Zuletzt geandert durch Art. 142 G v. 20.11.2019 | 1626
Mittelbare Anderung durch Art. 8 Nr. 2 G v. 29.11.2018 | 2237 berticksichtigt
